import React, { useState } from "react";
import { BsChevronCompactLeft, BsChevronCompactRight } from "react-icons/bs";
import {RxDotFilled} from 'react-icons/rx'
const ImageSlider = () => {
  const slider = [
    {
      url: "https://s27363.pcdn.co/wp-content/uploads/2020/05/Travel-Quotes.jpg.optimal.jpg",
      title: "Image 1",
    },
    {
      url: "data:image/jpeg;base64,",
      title: "Image 2",
    },
    {
      url: "data:image/jpeg;base64,",
      title: "Image 3",
    },
    {
      url: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRyWRrxpVJH-ZL5ftaArD_-0CmSXV7i_iM4ww&usqp=CAU",
      title: "Image 4",
    },
  ];

  const [currentIndext, setCurrentIndext] = useState(0);

  const prevSlide = () => {
    const isFirstSlide = currentIndext == 0;
    const newIndex = isFirstSlide ? slider.length - 1 : currentIndext - 1;
    setCurrentIndext(newIndex);
  };
  const nextSlide = () => {
    const isEndSlide = currentIndext === slider.length - 1;
    const newIndex = isEndSlide ? 0 : currentIndext + 1;
    setCurrentIndext(newIndex);
  };
  const goToSlide = (slideIndex) => {
    setCurrentIndext(slideIndex);
  };

  return (
    <div className="max-w-[1400px] h-[580px] w-full m-auto py-16 px-4 relative group ">
      <div
        className="w-full h-full rounded-2xl bg-center bg-cover duration-500"
        style={{ backgroundImage: `url(${slider[currentIndext].url})` }}
      ></div>
      <div>
        <BsChevronCompactLeft
          onClick={prevSlide}
          className="absolute top-[50%] -translate-x-0 -translate-y-[-50%] left-5 text-3xl rounded-full p-2 bg-black/30 group-hover:bg-black/40 text-white cursor-pointer"
          size={30}
        />
      </div>
      <div>
        <BsChevronCompactRight
          onClick={nextSlide}
          className="absolute top-[50%] -translate-x-0 -translate-y-[-50%] right-5 text-3xl rounded-full p-2 bg-black/30 group-hover:bg-black/40 text-white cursor-pointer"
          size={30}
        />
      </div>

      <div className="flex top-4 justify-center py-2">
        {slider.map((slide, slideIndex) => (
          <div className="text-2xl cursor-pointer" key={slideIndex} onClick={()=>goToSlide(slideIndex)}>
            <RxDotFilled />
          </div>
        ))}
      </div>
    </div>
  );
};
export default ImageSlider;
